	(741, 1, 'Avatar: The Way of Water', 'Set more than a decade after the events of the first film, Avatar: The Way of Water begins to tell the story of the Sully family (Jake, Neytiri, and their kids), the trouble that follows them, the lengths they go to keep each other safe, the battles they fight to stay alive, and the tragedies they endure.\r\n\r\nDirected by James Cameron and produced by Cameron and Jon Landau, the film stars Zoe Saldana, Sam Worthington, Sigourney Weaver, Stephen Lang, Cliff Curtis, Joel David Moore, CCH Pounder, Edie Falco, Jemaine Clement and Kate Winslet.\r\n\r\nJames Camerons first follow-up to his Avatar, the highest-grossing film of all time, will open in cinemas on December 14, 2022.', '2022-12-14', 'PG', '', 193, 'Sam Worthington, Zoe Saldana, Bailey Bass, ', 'https://www.youtube.com/watch?v=d9MyW72ELq0', NULL, '0000002102', 20100618150216846, 'Cinema 2', 'HO00000289', '0000000002', NULL, NULL, '2023-02-02 17:00:00', '2023-02-02 07:06:05', '2023-02-02 07:06:05'),
